import React, { useState, useEffect } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Navigation from './components/Navigation';
import Home from './components/Home';


const App = () => {
  return (
    <>
      <Navigation />
      <Switch>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </>  
  );
}

export default App;
